import React from 'react';
import './App.css';
import DashboardCosmetique from "./Pages/DashboardCosmetique/DashboardCosmetique";
import DashboardMode from "./Pages/DashboardMode/DashboardMode";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Navbarre from "./Component/Navbarre/Navbarre";
import DashboardContextProvider from './context/DashboardContext';

export default function App() {
  return (
  <DashboardContextProvider>
  <BrowserRouter>
    <Routes>
        <Route path="/" element={<DashboardCosmetique />}/>
        <Route path="/dashboardMode" element={<DashboardMode />}/>
      </Routes>
    </BrowserRouter>
    </DashboardContextProvider>
  );
}
